import React from "react";
import "./tailwind.css";
import image from '../../assets/Hero-top.png'

const HeaderHero = () => {
  return (
    <div className="hero-container bg-gray-300 p-4">
      <img className="image" src={image} alt="big-image" />
      <div className="text-3xl font-bold text-gray-700">
        <p>COLLUSION</p>
        <p>An exclusive selection of this season's trends.</p>
        <div>
          <button className="px-4 py-2 rounded-full bg-blue-500 text-white font-bold">DISCOVER</button>
          <button className="px-4 py-2 rounded-full bg-blue-500 text-white font-bold ml-4">SHOP NOW</button>
        </div>
      </div>
    </div>
  );
};

export default HeaderHero;
